import React from 'react';
import { createRoot } from 'react-dom/client'; // Keep this one
import './index.css'; // Make sure this file exists and is correctly imported

import App from './App.jsx'; // Ensure this path is correct and App component exists

// Create a root and render the App component
const root = createRoot(document.getElementById('root')); // Make sure 'root' exists in your HTML

root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);
